import React from "react";
export const AddEmail = (email) => {
  return {
    type: "ADD_EMAIL",
    payload: {
      userEmail: email,
    },
  };
};

export const AddServiceType = (service) => {
  return {
    type: "ADD_SERVICETYPE",
    payload: {
      Service_type: service,
    },
  };
};

export const Selectservice = (selectservice) => {
  return {
    type: "Select_SERVICE",
    payload: {
      selectService: selectservice,
    },
  };
};
